import React from 'react';
import Draw from '../common/drawer';
import { useLocation } from 'react-router-dom';

const Home = () => {
    const location = useLocation();
    const userData = location.state?.userData || null;

    return (
        <div>
            {/* Other content */}
            {<Draw userData={userData} />}
        </div>
    );
};

export default Home;
